import React from 'react';
import { Carousel } from 'react-bootstrap';
import '../css/Inicio.css'

const Inicio = () => {
  return (
    <div style={{ padding: '20px' }} className='container'>
      <h2>Bienvenido a nuestra Clínica</h2>
      <h6>Ofrecemos servicios de medicina general y odontología con profesionales altamente capacitados.</h6>

      <Carousel fade>
        <Carousel.Item>
          <img
            
            src="data:image/jpeg;base64,"
            alt="Odontología"
          />
          <Carousel.Caption>
            <h3>Odontología</h3>
            <p>Cuida tu sonrisa con nuestros expertos dentales.</p>
          </Carousel.Caption>
        </Carousel.Item>

        <Carousel.Item>
          <img
            className="d-block w-100"
            src="data:image/jpeg;base64,"
            alt="Medicina General"
          />
          <Carousel.Caption>
            <h3>Medicina General</h3>
            <p>Atención médica integral para toda la familia.</p>
          </Carousel.Caption>
        </Carousel.Item>

        <Carousel.Item>
          <img
            className="d-block w-100"
            src="data:image/jpeg;base64,"
            alt="Chequeos Médicos"
          />
          <Carousel.Caption>
            <h3>Chequeos Preventivos</h3>
            <p>La prevención es el primer paso hacia una vida saludable.</p>
          </Carousel.Caption>
        </Carousel.Item>
      </Carousel>
    </div>
  );
};

export default Inicio;